import React from 'react';
import Card from '../comps/Card';
import { Cards } from '../style/comps';
import sample from '../photos/sample.jpeg'

const Home = () => {
    return (<div>
        <Cards>
            <Card title="title" photo={sample} />
            <Card />
            <Card />
            <Card />
            <Card />
        </Cards>
    </div>);
}

export default Home;
